&lt;p&gt;&lt;a href="http://www.flickr.com/people/eridony/"&gt;Eridony&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/eridony/5263897005/" title="Clock Tower Revealed"&gt;&lt;img src="http://farm6.static.flickr.com/5162/5263897005_4306cc80bd_m.jpg" width="183" height="240" alt="Clock Tower Revealed" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;This clock tower in Chicago was recently uncovered after many years of being hidden by sheet metal. It is now back to its original 1916 look and the clocks are working.&lt;br /&gt;
&lt;br /&gt;
The building is now called the Tailor Lofts. It is on the National Register of Historic Places.&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/jhdennis/"&gt;Type LT&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/jhdennis/5263899559/" title="Nova"&gt;&lt;img src="http://farm6.static.flickr.com/5009/5263899559_43b0aa2227_m.jpg" width="240" height="180" alt="Nova" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;Seeing this 1975 Nova this past June brought back memories of teenage joyrides with my friends in our bud's yellow '76 Nova.  Fred and I still talk.&lt;br /&gt;
&lt;br /&gt;
It was one of few regular production cars I've ever seen which managed to look menacing in yellow.&lt;/p&gt;

