&lt;p&gt;A building in Chicago's West Loop on the corner of Green and Jackson&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/people/eridony/"&gt;Eridony&lt;/a&gt; posted a photo:&lt;/p&gt;

&lt;p&gt;&lt;a href="http://www.flickr.com/photos/eridony/5264429514/" title="The International Tailoring Building"&gt;&lt;img src="http://farm6.static.flickr.com/5164/5264429514_d933e4e241_m.jpg" width="180" height="240" alt="The International Tailoring Building" /&gt;&lt;/a&gt;&lt;/p&gt;

&lt;p&gt;This building in Chicago's West Loop was built in 1916 as a garment factory for the International Tailoring Company. &lt;br /&gt;
&lt;br /&gt;
In 2008 it was added to the National Register of Historic Places. In 2010 a renovation was completed that transformed it into the Tailor Lofts, an apartment building for University of Illinois-Chicago students. The renovation included revealing the clock tower which had been covered for years by sheet metal.&lt;/p&gt;

